import { Button } from 'antd'
import styled from 'styled-components'

export const ButtonStyled = styled(Button)`
width: 208px;
height: 50px;
margin: 20px 0;
background-color: rgba(1,86,255,1);
`

export const List = styled.ul`
list-style: disc inside;
font-size: 14px;
line-height: 30px;
font-weight: 300;
color: rgba(0,0,0,1);
`
